var grobjects = grobjects || [];

var m4 = twgl.m4;


(function(){
    "use restrict";
    var shaderProgram = undefined;
    var gl = undefined;
    var createGLTexture = function (gl, image, flipY) {
        var texture = gl.createTexture();
        gl.bindTexture(gl.TEXTURE_2D, texture);
        if(flipY){
            gl.pixelStorei(gl.UNPACK_FLIP_Y_WEBGL, true);
        }
        gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, image);
        gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.LINEAR);
        gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER,  gl.LINEAR);
        gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.CLAMP_TO_EDGE);
        gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.CLAMP_TO_EDGE);
        gl.generateMipmap(gl.TEXTURE_2D);
        gl.bindTexture(gl.TEXTURE_2D, null);
        return texture;
    };

    function Volcano(centerPosition){
        this.arrayBuffer = undefined;
        this.normalData = undefined;
        this.vertexPositionData = undefined;
        this.color = [0.5,0.3,0.7];
        this.centerPosition = centerPosition;
        this.textureCoordData = undefined;
        this.texture = undefined;

        this.draw = function(drawingState){
            var model = m4.multiply(m4.scaling([3,4,3]),m4.translation(this.centerPosition));

            drawingState.gl.useProgram(shaderProgram.program);
            drawingState.gl.bindTexture(drawingState.gl.TEXTURE_2D, this.texture);
            twgl.setUniforms(shaderProgram,{
                view:drawingState.view, proj:drawingState.proj, lightdir:drawingState.sunDirection,
                cubecolor:this.color,
                model: model,
                dynamiclight:drawingState.dynamiclight});

            twgl.setBuffersAndAttributes(gl,shaderProgram,this.arrayBuffer);
            twgl.drawBufferInfo(gl, gl.TRIANGLES, this.arrayBuffer);
        };
        this.center = function(drawingState){
            return this.centerPosition;
        };
        this.name = "volcano";


    }

    Volcano.prototype.init = function(drawingState){
        this.initShaderRelated(drawingState);
        this.prepareData();
        var image = new Image();

        image.src="data:image/jpeg;base64,"
        this.texture = createGLTexture(drawingState.gl, image);
        var array = {
            vnormal:{numComponents:3, data:this.normalData},
            vpos:{numComponents:3, data:this.vertexPositionData},
            vTexCoor:{numComponents:2, data:this.textureCoordData},
            indices:this.indexData
        };

        this.arrayBuffer = twgl.createBufferInfoFromArrays(drawingState.gl,array);
    };

    Volcano.prototype.initShaderRelated = function (drawingState){
        gl = drawingState.gl;
        if (!shaderProgram) {
            shaderProgram = twgl.createProgramInfo(gl, ["roundhouse-vs", "roundhouse-fs"]);
        }
    };

    Volcano.prototype.prepareData = function (){

        var latitudeBands = 15;
        var longitudeBands =15;
        var radius = 1;

        var vertexPositionData = [];
        var normalData = [];
        this.tureCoordData = [];

        var height = 1;
        var topPoint = [0,height,0];
        var squareSide = 1;
        var squareHalfSide = squareSide/2;

        // Clockwise
        var bottomSquareVertex = [squareHalfSide, 0, squareHalfSide,   squareHalfSide,0 ,-squareHalfSide,
            -squareHalfSide,0, -squareHalfSide, -squareHalfSide, 0 ,squareHalfSide];
        this.vertexPositionData= bottomSquareVertex.concat(topPoint);

        this.textureCoordData= [
            //1,1,  1,0, 1,1 , 1,0, 0,0
			1,0, 0,0, 1,0, 0,0, 0.5,0.5
			
        ];

        // indices
        var indices = [
            0,1,3,  2,1,3,
            0,1,4,  0,3,4,
            2,1,4,  2,3,4
        ];
        this.indexData = indices;
        var indexData = new Uint8Array(indices);

        // normal
        // use cross for each vertex
        var vertex0 = [squareHalfSide, 0, squareHalfSide];
        var vertex1 = [squareHalfSide, 0, -squareHalfSide];
        var vertex2 = [-squareHalfSide, 0, -squareHalfSide];
        var vertex3 = [-squareHalfSide, 0, squareHalfSide];
        var vertex4 = topPoint;

        var getVector = function(a, b){
            var vector = [a[0]-b[0],a[1]-b[1],a[2]-b[2]];
            return vector
        };

        var normalData =[];
        var v3 = twgl.v3;
        var normal1 = v3.cross(getVector(vertex3, vertex0), getVector(vertex1, vertex0));
        var normal2 = v3.cross(getVector(vertex2, vertex3), getVector(vertex1, vertex3));
        var normal3 = v3.cross(getVector(vertex1,vertex0),getVector(vertex3, vertex1));
        var normal4 = v3.cross(getVector(vertex4, vertex0), getVector(vertex3, vertex0));
        var normal5 = v3.cross(getVector(vertex4, vertex2), getVector(vertex1, vertex2));
        var normal6 = v3.cross(getVector(vertex4, vertex3), getVector(vertex2, vertex3));

        function appendNormal(normalData, normal){
            for (var j=0; j < 3; j++){
                for (var i =0; i <3; i++){
                    normalData.push(normal[i]);
                }
            }
            return normalData
        }

        normalData = appendNormal(normalData, normal1);
        normalData = appendNormal(normalData, normal2);
        normalData = appendNormal(normalData, normal3);
        normalData = appendNormal(normalData, normal4);
        normalData = appendNormal(normalData, normal5);
        normalData = appendNormal(normalData, normal6);

        for (var i = 0; i< normalData.length; i++ ){
            normalData[i] *= -1;
        }

        this.normalData = normalData;

        var vertexColor =[];
        for (var index =0; index < indexData.length*3; index++){
            if (index % 3 == 0) {
                vertexColor.push(1);
            } else {
                vertexColor.push(0);
            }
        }
        vertexColor = new Float32Array(vertexColor);
    };

    var volcano = new Volcano([5.5,-3,2]);
    grobjects.push(volcano);

}());







